import styled from "styled-components";

export const Container = styled.div`
    font-family: 'Open Sans';
    display: flex;
    width: 100%;
    position: fixed;
    bottom: 0;
    height: 25px;
    color: white;
    background: #3E4C5E;
    justify-content: center;
    align-items: top;
    p {
        font-family: "Open Sans";
        margin-top: 2px;
    }
`;
